function loadUsers() {
    var listUsers = [];
    var i = 0;
    var key ;
    do {
        key = 'u'.concat(i.toString());
        listUsers.push(JSON.parse(localStorage.getItem(key)));
        i++;
    } while (localStorage.getItem(key))
    return listUsers;
} export default loadUsers;
